import React from 'react';

import Ingredients from './components/Ingredients/Ingredients';
import Auth from './components/Auth';
import {AuthContext} from './context/auth-context';

const App = props => {
  let content = <Auth />;
  if(AuthContext.isAuth){ content = <Ingredients /> }

  return content;
};

export default App;
